import React, { useState } from "react";

const ExpandButton = ({ toggleExpand, setToggleExpand }) => {
  return (
    <button
      className="expand_button"
      onClick={() => setToggleExpand(!toggleExpand)}
    >
      Expand
    </button>
  );
};

export default ExpandButton;
